import React, { Component } from 'react';
import Friend from './Components/Friend';

class FriendsList extends Component {
    constructor() {
        super();
        this.state=({
            friends: []
        });
    }

    render() {
        return(
            <div>
                {
                    this.state.friends.map(friend => (
                        <Friend 
                            name={friend.name}
                            age={friend.age}
                            email={friend.email}
                        />
                    ))
                }
            </div>
        );
    }
}

export default FriendsList;
